import './App.css';

const Title =()=><h1>แอพรายรับ - รายจ่าย</h1>
const Description =()=><p>บันทึกข้อมูลบัญชีในแต่ละวัน</p>

const Item =()=>{
  return(
    <ul>
      <li>ค่าเดินทาง <span>-200</span></li>
      <li>เงินเดือน <span>+20,00</span></li>
      <li>เงินค่าอาหาร <span>-500</span></li>
    </ul>
  );
}

const Transection =()=>{
  return (
    <ul>
        <Item/>
    </ul>
  );

}

function App() {
  return (
    <div className="App">
        <Title/>
        <Description/>
        <Transection/>
    </div>
  );
}

export default App;
